classes.content:
self .FdVirtualGrid .innerScrollContainer .selected {
	background-color: transparent;
}

self .FdVirtualGrid .innerScrollContainer .items-center:hover {
	background-color: transparent;
}

self .FdVirtualGrid .innerScrollContainer .items-center .matrixItem:hover {
	box-shadow: #5f86ea 0px 0px 0px 2px;
}

self .FdVirtualGrid > div .selected { 
	background-color: transparent;
}
self .FdVirtualGrid > div :hover{
	background: transparent;
}
self .FdVirtualGrid{
	width: fit-content !important;
	/* width:calc(100%-4*299px) !important; */
}

self button[data-headlessui-state] {
	font-size: 16px !important;
	color: #66687d;
	background-color: transparent;
	padding: 12px 12px;
}

self button[data-headlessui-state="selected"] {
	color: #EA5F71 !important;
	background-color: transparent !important;
	font-weight: 500 !important;
}

self button[data-headlessui-state="selected"]:after {
	background-color: #EA5F71;
}

self {
	box-shadow: 0px 2px 0px 0px #333;
}
self:hover {
	opacity: 0.8;
}
self:active {
	opacity: 1;
}

self {
	box-shadow: 0px 2px 0px 0px #C0C6E2;
}
self:hover {
	opacity: 0.8;
}
self:active {
	opacity: 1;
}

self {
	font-weight: 500;
	color: white;
}

self:has(p span[title="open"]) {
	background-color: #08aeea !important;
}

self:has(p span[title="in progress"]) {
	background-color: #b99897 !important;
}

self:has(p span[title="to be tested"]) {
	background-color: #f36969 !important;
}

self:has(p span[title="closed"]) {
	background-color: #49e6cf !important;
}

self:has(p span[title="notDeadline"]){
	color: #3A5BCD;
}

self:has(p span[title="todayDeadline"]){
	color: #57ae56;
}

self:has(p span[title="overDue"]){
	color: #EA5F71;
	font-weight: 600 !important;
}

self {
	font-weight: 600 !important;
	background-color: #B02C86;
	color: white;
	display: flex;
}

self:has(p span[title="Done"]) {
	background-color: #009966 !important;
}

self:has(p span[title="Doing"]),
self:has(p span[title="In Progress"]) {
	background-color: #0069ee !important;
}

self:has(p span[title="TODO"]),
self:has(p span[title="ToDo"]),
self:has(p span[title="Todo"]) {
	background-color: #9dc3e9 !important;
	color: black !important;
}

self:has(p span[title="Closed"]) {
	background-color: #2D264B !important;
	display: none !important;
}

/*to eliminate the purple background when selecting an item*/
self .virtualizer-list .virtualizer-item.selected {
	background-color: transparent;
}
